        "tarball_url": "https://api.github.com/repos/paritytech/parity-ethereum/tarball/v2.6.5",
        "zipball_url": "https://api.github.com/repos/paritytech/parity-ethereum/zipball/v2.6.5",
        "body": "Parity Ethereum v2.6.5-beta is a patch release that adds block numbers for activating the Istanbul hardfork on mainnet, as well as a large number of various bugfixes, QoL changes, some code cleanup/refactoring and other miscellaenous changes.\r\n\r\nThis release removes legacy aliases for the mainnet. If you specify `--chain homestead`, `--chain frontier` or `--chain byzantium`, this will need to be changed to one of: `--chain eth`, `--chain ethereum`, `--chain foundation` or `--chain mainnet`.\r\n\r\nThis release includes important changes to how snapshots are produced. The size of the Ethereum account state means that producing a snapshot takes a long while; most nodes today are not able to finish before the relevant state is pruned. Starting with v2.6.5, pruning is paused while a snapshot is underway, hopefully fixing the current dearth of recent snapshots. The downside to this is that memory usage goes up while a snapshot is produced.\r\n\r\nThe full list of included changes:\r\n\r\n* [CI] check evmbin build (#11096)\r\n* Correct EIP-712 encoding (#11092)\r\n* [client]: Fix for incorrectly dropped consensus messages (#11082) (#11086)\r\n* Update hardcoded headers (foundation, classic, kovan, xdai, ewc, ...) (#11053)\r\n* Add cargo-remote dir to .gitignore (?)\r\n* Update light client headers: ropsten 6631425 foundation 8798209 (#11201)\r\n* Update list of bootnodes for xDai chain (#11236)\r\n* ethcore/res: add mordor testnet configuration (#11200)\r\n* [chain specs]: activate Istanbul on mainnet (#11228)\r\n* [builtin]: support multiple prices and activations in chain spec (#11039)\r\n* [receipt]: add sender & receiver to RichReceipts (#11179)\r\n* [ethcore/builtin]: do not panic in blake2pricer on short input (#11180)\r\n* Made ecrecover implementation trait public (#11188)\r\n* Fix docker centos build (#11226)\r\n* Update MIX bootnodes. (#11203)\r\n* Insert explicit warning into the panic hook (#11225)\r\n* Use provided usd-per-eth value if an endpoint is specified (#11209)\r\n* Cleanup stratum a bit (#11161)\r\n* Add Constantinople EIPs to the dev (instant_seal) config (#10809) (already backported)\r\n* util Host: fix a double Read Lock bug in fn Host::session_readable() (#11175)\r\n* ethcore client: fix a double Read Lock bug in fn Client::logs() (#11172)\r\n* Type annotation for next_key() matching of json filter options (#11192)\r\n* Upgrade jsonrpc to latest (#11206)\r\n* [dependencies]: jsonrpc 14.0.1 (#11183)\r\n* Upgrade to jsonrpc v14 (#11151)\r\n* Switching sccache from local to Redis (#10971)\r\n* Snapshot restoration overhaul (#11219)\r\n* Add new line after writing block to hex file. (#10984)\r\n* Pause pruning while snapshotting (#11178)\r\n* Change how RPCs eth_call and eth_estimateGas handle \"Pending\" (#11127)\r\n* Fix block detail updating (#11015)\r\n* Make InstantSeal Instant again #11186\r\n* Filter out some bad ropsten warp snapshots (#11247)\r\n\r\n| System | Architecture | Binary | Sha256 Checksum |\r\n|:---:|:---:|:---:|:---|\r\n| <img src=\"https://gist.github.com/5chdn/1fce888fde1d773761f809b607757f76/raw/44c4f0fc63f1ea8e61a9513af5131ef65eaa6c75/windows.png\" alt=\"Windows Icon by Pixel Perfect from https://www.flaticon.com/authors/pixel-perfect\" style=\"width: 32px;\"/> | x64 | [parity.exe](https://releases.parity.io/ethereum/v2.6.5/x86_64-pc-windows-msvc/parity.exe) | `961238cf3d0f31df4c5bd1f6aa70e6a2d443bbd3375fd884879de33cc5e27beb` |\r\n| <img src=\"https://gist.github.com/5chdn/1fce888fde1d773761f809b607757f76/raw/44c4f0fc63f1ea8e61a9513af5131ef65eaa6c75/apple.png\" alt=\"Apple Icon by Pixel Perfect from https://www.flaticon.com/authors/pixel-perfect\" style=\"width: 32px;\"/> | x64 | [parity](https://releases.parity.io/ethereum/v2.6.5/x86_64-apple-darwin/parity) | `bd9fa27358ad4043175d97b5e3b6e7274e5db11b32df6eff5cc5781621752380` |\r\n| <img src=\"https://gist.github.com/5chdn/1fce888fde1d773761f809b607757f76/raw/44c4f0fc63f1ea8e61a9513af5131ef65eaa6c75/linux.png\" alt=\"Linux Icon by Pixel Perfect from https://www.flaticon.com/authors/pixel-perfect\" style=\"width: 32px;\"/> | x64 | [parity](https://releases.parity.io/ethereum/v2.6.5/x86_64-unknown-linux-gnu/parity) | `62762f424ffcc9ea939f3e09904d64600c4966045a865cfd94f23cf967213a0d` |\r\n| | | | |\r\n| **System** | **Option** | - | **Resource** |\r\n| <img src=\"https://gist.github.com/5chdn/1fce888fde1d773761f809b607757f76/raw/44c4f0fc63f1ea8e61a9513af5131ef65eaa6c75/apple.png\" alt=\"Apple Icon by Pixel Perfect from https://www.flaticon.com/authors/pixel-perfect\" style=\"width: 32px;\"/> | Homebrew | - | [github.com/paritytech/homebrew-paritytech](https://github.com/paritytech/homebrew-paritytech/) |\r\n| <img src=\"https://gist.github.com/5chdn/1fce888fde1d773761f809b607757f76/raw/44c4f0fc63f1ea8e61a9513af5131ef65eaa6c75/linux.png\" alt=\"Linux Icon by Pixel Perfect from https://www.flaticon.com/authors/pixel-perfect\" style=\"width: 32px;\"/> | Snapcraft | - | [snapcraft.io/parity](https://snapcraft.io/parity) |\r\n| <img src=\"https://gist.github.com/5chdn/1fce888fde1d773761f809b607757f76/raw/44c4f0fc63f1ea8e61a9513af5131ef65eaa6c75/settings.png\" alt=\"Settings Icon by Pixel Perfect from https://www.flaticon.com/authors/pixel-perfect\" style=\"width: 32px;\"/> | Docker | - | [hub.docker.com/r/parity/parity](https://hub.docker.com/r/parity/parity) |\r\n| <img src=\"https://gist.github.com/5chdn/1fce888fde1d773761f809b607757f76/raw/44c4f0fc63f1ea8e61a9513af5131ef65eaa6c75/settings.png\" alt=\"Settings Icon by Pixel Perfect from https://www.flaticon.com/authors/pixel-perfect\" style=\"width: 32px;\"/> | All binaries | - | [vanity-service.parity.io/parity-binaries?version=v2.6.5](https://vanity-service.parity.io/parity-binaries?format=markdown&version=v2.6.5) |"
